import React from "react";

function Jumbotron() {
    return (
        <div className="jumbotron col-9 mx-auto mt-5">
            <h1 className="display-4">Hello, welcome to Google Book Search!</h1>
            <p className="lead">This react app allows you to search and save books of interest.</p>
        </div>
    );
}

export default Jumbotron;
